import React from 'react';
import { Route, Redirect } from 'react-router-dom';

export default function PrivateRoute({
    component: Component,
    authed,
    ...rest
}) {
    return (
        <Route
            {...rest}
            render={props =>
                authed === true ? (
                    <Component {...props} />
                ) : (
                    <Redirect
                        to={{
                            pathname: '/signin',
                            state: { from: props.location },
                        }}
                    />
                )
            }
        />
    );
}
